(function ( w, d, n ) {
	
	'use strict';

	class Acciones{
		
		constructor(){

			this.loading = '<img src="data:image/gif;base64," /> ';



		}

		mensajes( msj, tipo = 'alert-success' ){
			let mensaje  = 	`<div class="alert alert-dismissible ${tipo}">
							  	<button type="button" class="close" data-dismiss="alert">&times;</button>
							  	${msj}
							 </div>`;
			return mensaje;
		}

		getEdad(fecha){
			var fechaNac = new Date(fecha);
		    var fechaActual = new Date();
		    var edad = fechaActual.getFullYear() - fechaNac.getFullYear();

		    fechaNac.setFullYear(fechaActual.getFullYear());

		    if (fechaActual < fechaNac){
		        edad--;
		    }

		    return edad;
		}

		

	}

	if (typeof w.acciones==='undefined') {
		w.acciones = new Acciones();

	}else {
		console.log('Ya existe la librerÃ­a acciones');
	}

})( window, document, navigator );